import "./styles.css";

export default function App() {

const e = document.getElementById('e1_2');

e.addEventListener('mouseover',()=>{
  const e = document.getElementById('e1_2');
  e.innerText = "";
})
  return (
    <div className="App">
        <div id="e1_12">
        <div id="e1_2">M</div>
        <div id="e1_7">A</div>
        <div id="e1_4">T</div>
        <div id="e1_8">T</div>
      </div>
    </div>
  );
}
